function getImdbCode() {
	var adres=window.location.href;
	var ilk='imdb.com/title/';
	var imdbCode=adres.substring(adres.indexOf(ilk)+15);
	if(imdbCode.indexOf('/')>0)
	imdbCode=imdbCode.replace('/','');	
	return imdbCode;
}


function getTitle() {
	var title = document.title;
	title = title.match(/^(.*) \(/)[1];
	regexp = /\(.*\)/g;
	title = title.replace(regexp, "");
	return title;
}


var title = getTitle();

var imdbID = getImdbCode();


//HDFilm
unsafeWindow.$('<a>')
	.attr('href', 'http://www.bluraytr.com/search.php?do=process&q=' + imdbID)
	.attr('target','_blank')
	.css({ marginRight: '.25em', position: 'relative', top: 3 })
	.append('<img src="data:image/x-icon;base64,%3D">')
	.appendTo('h1.header');
